import React, {useEffect, useState} from "react";
import axios from "axios";

const MainScreen = () => { 
    useEffect(() => {
        axios.get("http://localhost:3000/api/v1/reportits")
        .then((r) => {
            setUsers(r.data);
        });
    }, []);

}
export default MainScreen;
